import css from "./TitleTextPicButton.css";
import Button from "../Button/Button.js";

const TitleTextPicButton = props => (
  <div className={css.container}>
    <img className={css.image} src="https://i1.sndcdn.com/artworks-000478704579-o7peaj-t500x500.jpg" />
    <div className={css.rightHalfContainer}>
        <div className={css.tagline}>Start-up Culture, Corporate-Grade Service.</div>
        <div className={css.text}>We create an atmosphere that fosters creativity and professionalism. In this way, we allow our team to hone your vision with our digital strategy and build realities that will take your business to the next level.</div>
        <Button
          href="https://labs.chiedo.com/page/contact/"
          text="Get A Quote"
          style={{fontSize: "13px"}}
        />
    </div>
  </div>
);

export default TitleTextPicButton;
